import React from "react";
import { Line } from "react-chartjs-2";
import axios from "axios"

function Chart() {
    let contenderName = []
    let contenderValueHistory = []

    axios
        .get("https://fantasy-api.formula1.com/partner_games/f1/players#")
        .then(res => {
            console.log(res);
            for (const dataObj of res.data.players) {
                contenderName.push(dataObj.display_name)

                let seasonPrices = []
                for (const dataObj of res.data.players.season_prices) {
                    seasonPrices.push(dataObj.price)
                }
                contenderValueHistory.push(seasonPrices)
            }
        })
        .catch(err => {
            console.log(err);
        })
        console.log(contenderName, contenderValueHistory)

    const data = {
        labels: ["Monday", "Tuesday", "Wednesday", "Thursday", "Friday"],
        datasets: [
            {
                label: "Daily High Temps",
                data: [69, 69, 69, 69, 70],
                fill: false,
                backgroundColor: "rgb(255, 99, 132)",
                borderColor: "rgba(255, 99, 132, 0.2)"
            }
        ]
    };

    const options = {
        scales: { 
            yAxes: [
                { 
                    ticks: {
                        beginAtZero: true,
                        maxTicksLimit: 5
                    }
                }
            ]
        }
    }

    return (
        <div>
            <h1>F1 Fantasy Prices</h1>
            <Line data={data} options={options} />
        </div>
    );
}

export default Chart;
